import React from 'react';
import './App.css';
import OpenLink from './components/OpenLink';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Mesh App Example</h3>
        <div className="OpenLink">
          <OpenLinkButton />
        </div>
      </header>
    </div>
  );
}

function OpenLinkButton() {
  // Functionality for the button inside OpenLink component
  const handleClick = () => {
    // Add functionality for opening the link here
    console.log('Opening link...');
  };

  return (
    <button className="OpenLinkButton" onClick={handleClick}>
      Open Link
    </button>
  );
}

export default App;
